import imaplib
import email
from email.header import decode_header
import os
import ssl
import sys
import getpass
from datetime import datetime

def clean_filename(filename):
    return "".join(c for c in filename if c.isalnum() or c in (' ', '.', '_')).rstrip()

def decode_string(string, encoding):
    if isinstance(string, bytes):
        return string.decode(encoding or 'utf-8', errors='replace')
    return string

def save_email_content(msg, folder_path):
    try:
        body = ""
        if msg.is_multipart():
            for part in msg.walk():
                ctype = part.get_content_type()
                cdispo = str(part.get('Content-Disposition'))
                if ctype == 'text/plain' and 'attachment' not in cdispo:
                    body = decode_string(part.get_payload(decode=True), part.get_content_charset())
                    break
        else:
            body = decode_string(msg.get_payload(decode=True), msg.get_content_charset())
        
        with open(os.path.join(folder_path, 'email_content.txt'), 'w', encoding='utf-8') as f:
            f.write(f"Subject: {msg['Subject']}\n")
            f.write(f"From: {msg['From']}\n")
            f.write(f"To: {msg['To']}\n")
            f.write(f"Date: {msg['Date']}\n\n")
            f.write(body)
        return True
    except Exception as e:
        print(f"  Error saving email content: {e}")
        return False

def main():
    EMAIL = input("Enter your Shaw email address: ")
    PASSWORD = getpass.getpass("Enter your Shaw email password: ")

    if not EMAIL or not PASSWORD:
        print("Error: Email or password not provided.")
        sys.exit(1)

    context = ssl.create_default_context()
    context.set_ciphers("DEFAULT:!DH")

    try:
        mail = imaplib.IMAP4_SSL("imap.shaw.ca", ssl_context=context)
        mail.login(EMAIL, PASSWORD)
        mail.select("inbox")

        status, messages = mail.search(None, "ALL")
        email_ids = messages[0].split()

        base_dir = "c:\\emails"
        os.makedirs(base_dir, exist_ok=True)

        total_emails = len(email_ids)
        processed_emails = 0
        skipped_emails = 0

        for email_id in email_ids:
            try:
                status, msg_data = mail.fetch(email_id, "(RFC822)")
                for response_part in msg_data:
                    if isinstance(response_part, tuple):
                        msg = email.message_from_bytes(response_part[1])
                        subject, encoding = decode_header(msg["Subject"])[0]
                        subject = decode_string(subject, encoding)
                        from_ = msg.get("From")
                        date_str = msg.get("Date")
                        try:
                            date = datetime.strptime(date_str, "%a, %d %b %Y %H:%M:%S %z")
                        except ValueError:
                            date = datetime.now()  # Use current date if parsing fails
                        
                        folder_name = clean_filename(f"{date.strftime('%Y-%m-%d_%H-%M-%S')}_{subject[:30]}")
                        folder_path = os.path.join(base_dir, folder_name)
                        os.makedirs(folder_path, exist_ok=True)

                        print(f"Processing: {subject}")
                        if save_email_content(msg, folder_path):
                            for part in msg.walk():
                                if part.get_content_maintype() == "multipart":
                                    continue
                                if part.get("Content-Disposition") is None:
                                    continue
                                filename = part.get_filename()
                                if filename:
                                    filename = decode_string(decode_header(filename)[0][0], decode_header(filename)[0][1])
                                    filepath = os.path.join(folder_path, clean_filename(filename))
                                    with open(filepath, "wb") as f:
                                        f.write(part.get_payload(decode=True))
                                    print(f"  Attachment saved: {filename}")
                            processed_emails += 1
                        else:
                            skipped_emails += 1
            except Exception as e:
                print(f"Error processing email: {e}")
                skipped_emails += 1

        mail.logout()
        print("\nEmail download completed.")
        print(f"Total emails: {total_emails}")
        print(f"Processed emails: {processed_emails}")
        print(f"Skipped emails: {skipped_emails}")

    except imaplib.IMAP4.error as e:
        print(f"An IMAP error occurred: {e}")
    except ssl.SSLError as e:
        print(f"An SSL error occurred: {e}")
    except Exception as e:
        print(f"An unexpected error occurred: {e}")

if __name__ == "__main__":
    main()
